                    catch {
                        Write-Host "[BeforeAll-LLM] Exception testing $moduleName : $($_.Exception.Message)" -ForegroundColor Red
                        Write-Debug "[BeforeAll-LLM] Exception testing module $moduleName : $($_.Exception.Message)"
                        if ($script:LLMModulesAvailable -and $script:LLMModulesAvailable.ContainsKey($moduleName)) {
                            $script:LLMModulesAvailable[$moduleName] = $false
                        }
                    }
                }
            } else {
                Write-Host "[BeforeAll-LLM] ERROR: llmModulePaths not properly initialized" -ForegroundColor Red
            }
        }

