            }
            
            Write-Debug "[BeforeAll-LLM] Script variables already initialized at top level for discovery phase"
            
            # Test and update module availability (variables already initialized at script level)
            if ($llmModulePaths -and $llmModulePaths.Keys) {
                Write-Host "[BeforeAll-LLM] Testing availability for $($llmModulePaths.Count) modules..." -ForegroundColor Yellow
                foreach ($moduleName in $llmModulePaths.Keys) {
                    if ([string]::IsNullOrEmpty($moduleName)) {
                        Write-Debug "[BeforeAll-LLM] Skipping null/empty module name"
                        continue
                    }
                    
                    try {
                        Write-Host "[BeforeAll-LLM] Testing module: $moduleName" -ForegroundColor Gray
                        $moduleResult = Test-ModuleAvailable -ModuleName $moduleName -ModulePath $llmModulePaths[$moduleName]
                        if ($script:LLMModulesAvailable -and $script:LLMModulesAvailable.ContainsKey($moduleName)) {
                            $script:LLMModulesAvailable[$moduleName] = $moduleResult
                            Write-Host "[BeforeAll-LLM] Module $moduleName result: $moduleResult" -ForegroundColor Green
                        }
                        Write-Debug "[BeforeAll-LLM] Module $moduleName availability: $moduleResult"
                    }
                    catch {
                        Write-Host "[BeforeAll-LLM] Exception testing $moduleName : $($_.Exception.Message)" -ForegroundColor Red
                        Write-Debug "[BeforeAll-LLM] Exception testing module $moduleName : $($_.Exception.Message)"
                        if ($script:LLMModulesAvailable -and $script:LLMModulesAvailable.ContainsKey($moduleName)) {
                            $script:LLMModulesAvailable[$moduleName] = $false
                        }
                    }
                }
            } else {
                Write-Host "[BeforeAll-LLM] ERROR: llmModulePaths not properly initialized" -ForegroundColor Red
            }
        }

