                    $cached | Should -Be $response
                }
            }
            
            It "Should handle TTL expiration" -Skip:(-not $script:LLMModulesAvailable['LLM-ResponseCache']) {
                Measure-TestPerformance -TestName "Cache-TTL" -ScriptBlock {
