            Write-Host "!!!!!! [BeforeAll-TEMPLATES] BEFOREALL BLOCK REACHED DURING RUN PHASE !!!!!!" -ForegroundColor Red
            Write-Host "  Initializing Templates test environment..." -ForegroundColor Yellow
            
            # Template module paths
            $templateModulePaths = @{
                'Templates-PerLanguage' = "$PSScriptRoot\Modules\Unity-Claude-Enhanced-DocumentationGenerators\Core\Templates-PerLanguage.psm1"
                'AutoGenerationTriggers' = "$PSScriptRoot\Modules\Unity-Claude-Enhanced-DocumentationGenerators\Core\AutoGenerationTriggers.psm1"
            }
            
            Write-Debug "[BeforeAll-Templates] Script variables already initialized at top level for discovery phase"
            
            # Test and update module availability (variables already initialized at script level)
            if ($templateModulePaths -and $templateModulePaths.Keys) {
                Write-Host "[BeforeAll-Templates] Testing availability for $($templateModulePaths.Count) modules..." -ForegroundColor Yellow
                foreach ($moduleName in $templateModulePaths.Keys) {
                    if ([string]::IsNullOrEmpty($moduleName)) {
                        Write-Debug "[BeforeAll-Templates] Skipping null/empty module name"
                        continue
                    }
                    
                    try {
                        Write-Host "[BeforeAll-Templates] Testing module: $moduleName" -ForegroundColor Gray
                        $moduleResult = Test-ModuleAvailable -ModuleName $moduleName -ModulePath $templateModulePaths[$moduleName]
                        if ($script:TemplateModulesAvailable -and $script:TemplateModulesAvailable.ContainsKey($moduleName)) {
                            $script:TemplateModulesAvailable[$moduleName] = $moduleResult
                            Write-Host "[BeforeAll-Templates] Module $moduleName result: $moduleResult" -ForegroundColor Green
                        }
                        Write-Debug "[BeforeAll-Templates] Module $moduleName availability: $moduleResult"
                    }
                    catch {
                        Write-Host "[BeforeAll-Templates] Exception testing $moduleName : $($_.Exception.Message)" -ForegroundColor Red
                        Write-Debug "[BeforeAll-Templates] Exception testing module $moduleName : $($_.Exception.Message)"
                        if ($script:TemplateModulesAvailable -and $script:TemplateModulesAvailable.ContainsKey($moduleName)) {
                            $script:TemplateModulesAvailable[$moduleName] = $false
                        }
                    }
                }
            } else {
                Write-Host "[BeforeAll-Templates] ERROR: templateModulePaths not properly initialized" -ForegroundColor Red
            }
        }

