                }
                
                $stopwatch.Stop()
                $avgTimePerOp = $stopwatch.ElapsedMilliseconds / ($operations * 2)
                
                # Should complete operations in under 1ms each
                $avgTimePerOp | Should -BeLessThan 1.0
            }
            
