                $changes = @()
                foreach ($file in $filesToModify) {
                    Add-Content -Path $file -Value "`n# Modified at $(Get-Date)"
                    # Simple change detection - just record that file was modified
                    $changes += @{
                        FilePath = $file
                        ChangeType = "Modified"
                        Timestamp = Get-Date
                    }
                }
                
